import React, { Component } from 'react';
import { AgGridReact } from 'ag-grid-react';
import 'ag-grid-community/dist/styles/ag-grid.css';
import 'ag-grid-community/dist/styles/ag-theme-material.css';
import "ag-grid-enterprise";

class ErrorLog extends Component {
    constructor(props) {
        super(props);
        this.state = {
          columnDefs: [{
            headerName: "Error ID", field: "error", colId: "error", 
          }, {
            headerName: "Description", field: "description", width: 300,  
          }, {
            headerName: "Flow", field: "flow"
          }, {
            headerName: "Error Type", field: "type"
          }, {
            headerName: "Emergency Level", field: "emergency", 
            cellClassRules: {
                "urgent": function(params) {
                  return params.data.emergency === "urgent"
                },
                "priority": function(params) {
                  return params.data.emergency === "priority"
                }
              },
          }],
          rowData: [{
            error: "00001", description: "description...", flow: 35, type: "typeA", emergency: "urgent"
          }, {
            error: "00002", description: "description...", flow: 32, type: "typeA", emergency: "priority"
          }, {
            error: "00003", description: "description...", flow: 12, type: "typeB", emergency: "general"
          }, {
            error: "00004", description: "description...", flow: 22, type: "typeC", emergency: "general"
          }, {
            error: "00005", description: "description...", flow: 9, type: "typeD", emergency: "urgent"
          }],
          totalCount: 0,
          autoGroupColumnDef: {
            filterValueGetter: function(params) {
              var colGettingGrouped = params.colDef.showRowGroup;
              var valueForOtherCol = params.api.getValue(colGettingGrouped, params.node);
              return valueForOtherCol;
            }
        }
        };


    }

    //   componentDidMount() {
    //     fetch('https://api.myjson.com/bins/15psn9')
    //         .then(result => result.json())
    //         .then(rowData => this.setState({rowData}))
    // }

    render() {
        return (


               <div className="container" style={{
                    display: "contents",
                    justifyContent: "center",
                    marginTop: "60px"
                  }}>
                      <div className="container" style={{
                    backgroundColor: "#F7F7F7",
                    marginTop: "30px",
                    justifyContent: "center",
                    border: "1px solid #F7F7F7",
                    height: "35px"
                }}/>
                <div className="container" style={{
                    padding: "30px",
                    justifyContent: "center",
                    border: "1px solid #F7F7F7",
                    height: "110px"
                }}>
                    <h5 style={{
                        paddingLeft:"10px",
                        borderLeft: "5px solid #555555"
                    }}>Unread Errors</h5>
                    <p style={{
                        paddingLeft:"16px", fontSize: "14px"}}>Total Count: {this.state.totalCount}</p>
                </div>

                <div style={{
                    height: '500px', 
                    justifyContent: "center",
                    margin: "auto",
                    border: "1px solid #f7f7f7"
                }}
                    className="ag-theme-material container"
                >

                    <AgGridReact 
                        enableColResize={true}
                        enableFilter={true}
                        pagination={true} 
                        paginationAutoPageSize={true}
                        columnDefs={this.state.columnDefs}
                        rowData={this.state.rowData}
                        alignedGrids={'center'}
                        animateRows={true}
                        defaultColDef={this.state.defaultColDef}
                        enableRangeSelection={true}
                        groupHideOpenParents={true}
                        autoGroupColumnDef={this.state.autoGroupColumnDef}
                    >
                    </AgGridReact>
                </div>
                </div>


        );
    }
}
export default ErrorLog;
